import web from '../src/images/bg-title-01.jpg';
import app from '../src/images/bg-title-01.jpg';
import digital from '../src/images/bg-title-01.jpg';

const SData = [
    {
        title: "Web Development",
        imgPath: web,
    },
    {
        title: "Mobile Development",
        imgPath: app,
    },
    {
        title: "Digital Marketing",
        imgPath: digital,
    },
];

export default SData;
